              Ch∆∞a c√≥ d·ªØ li·ªáu chuy√™n khoa
            </div>
          ) : (
            <div className="home-grid-4">
              {specialties.map(item => (
                <div key={item.id} className="home-card">
                  <div className="home-icon">
                    {item.icon || 'üè•'}
                  </div>
                  <div className="home-card-title">
                    {item.name}
                  </div>
                </div>
              ))}
            </div>
          )}
        </section>

      </main>
    </div>
  );
};

export default SpecialtyPage;
